import React from "react";
import CourseItem from "../../atom/courseItem";
import Banner from "./component/banner";
import Section from "../../atom/section";
import CommentBox from "./component/commentbox";
import Different from "./component/different";
import Testimonial from "./component/testimonial";

export default function Home() {
  return (
    <main className="homepage" id="main">
      <Banner />
      <Section
        topdes="The readable content of a page when looking at its layout. The point
            of using Lorem Ipsum is that it has a more-or-less normal"
        title="Khóa học Offline"
        className="courseoffline"
      >
        <div className="list row">
          <CourseItem
            imageAlt=""
            imageUrl="/img/img1.png"
            badge="Đã kết thúc"
            badgeClass="b1"
            user="12"
            heart="100"
            share=""
            name="Front-end căn bản"
            des="One of the best corporate fashion brands in Sydney"
            avatarAlt=""
            avatarImageUrl="/img/avt.png"
            mentor="Trần Nghĩa"
          />
          <CourseItem
            imageAlt=""
            imageUrl="/img/img1.png"
            badge="Đang diễn ra"
            badgeClass="b2"
            user="12"
            heart="100"
            share=""
            name="React JS"
            des="One of the best corporate fashion brands in Sydney"
            avatarAlt=""
            avatarImageUrl="/img/avt.png"
            mentor="Trần Nghĩa"
          />
          <CourseItem
            imageAlt=""
            imageUrl="/img/img1.png"
            badge="Sắp khai giảng"
            badgeClass="b3"
            user="12"
            heart="100"
